import { productsData } from "../data";
import Product from "./Product";
import styled from "styled-components";
const Container = styled.div`
  width: 100vw;
  display: flex;
  /* justify-content: space-between;
  align-items: center; */
  flex-wrap: wrap;
  height: 70vh;
`;

function Products() {
  return (
    <Container>
      {productsData.map((item) => (
        <Product item={item} />
      ))}
    </Container>
  );
}

export default Products;
